import { Component } from "react";
class Cl  extends Component
{
    constructor()
    {super()
        this.state=
        {data : "rani"}
    
}
change()
{
    this.setstate({data : "savita"})
}

render()
{return(
    <div><h1>{this.state.data}</h1>
    <button onClick={()=>this.change()}>ok</button></div>
)}
}
export default Cl
